import './componentes.scss';
import tileData from './tileData';

const Productos = () =>{
const Productos = tileData.map((pro, i) => <div key={i} id='producto 2'> {pro.title} <br/> {pro.author}</div>)
return(
        <>
        {Productos}
        </>
)
}

export default Productos
